import React from "react"
import {Link, Outlet} from "react-router-dom"
function login(){
    return(
        <>
        <h1 className="login-page">Your  successfully signed in</h1>
        <Link  to=''>
         <button class="btn btn-primary w-10 py-2" >Go</button>
         </Link>
        </>
    )
}

export default login;
